export default function Dog({
  name,
  height,
  weight,
  years,
  image,
  temperament,
}) {
  return (
    <div>
      <div>Name: {name}</div>
      <img src={image} alt="img" />
      <div>Height: {height}</div>
      <div>Weight: {weight}</div>
      <div>Years: {years}</div>
      <div>Temeperament: {temperament}</div>
    </div>
  );
}
